function CreateBook() {
	var player = parent.GetPlayer();



	var doc = new jsPDF('p', 'pt', 'letter');

	var font = '';

	doc.addFileToVFS('Roboto-normal.ttf', font);
	doc.addFont('Roboto-normal.ttf', 'Roboto', 'normal');

	doc.setFont('Roboto', 'normal');
	
	

	var num = player.GetVar("num");

	if (num == 1){
		var img1 = 'data:image/png;base64,';
		doc.addImage(img1, 'PNG', 0, 0, 612, 792);
	} else if (num == 2) {
		var img2 = 'data:image/png;base64,';
		doc.addImage(img2, 'PNG', 0, 0, 612, 792);
	
	} else if (num == 3) {
		var img3 = 'data:image/png;base64,';
		doc.addImage(img3, 'PNG', 0, 0, 612, 792);
	
	} else if (num == 4) {
		var img4 = 'data:image/png;base64,';
		doc.addImage(img4, 'PNG', 0, 0, 612, 792);
	}


	

	// Save the PDF
	doc.save('Workbook.pdf');
}